[Form]
public class CatVendorCatalogMaintenanceRequest extends FormRun
{
    boolean isNewCatalog;
    boolean isVendorExist;

}

public void close()
{
    FormDataSource  ds = FormDataUtil::getFormDataSource(element.args().record());
    super();
    ds.research(true);
}

public void init()
{
    super();

    if (! element.args().caller())
    {
        throw error(Error::missingFormActiveBuffer(element.name()));
    }
    isNewCatalog = element.args().menuItemName() == menuitemDisplayStr(CatVendorCatalogCreate);
    isVendorExist = true; // Assuming vendor is available for this catalog.

    this.setAllControls();
}

private void setAllControls()
{
    str     formCaption;
    formCaption  = isNewCatalog ? "@SYS339509" : "@SYS191120";

    this.design().caption(formCaption);
    catVendorcatalog_name.allowEdit(isNewCatalog);

    this.setControls();
}

public void setControls()
{
    boolean isCatalogDeleted;
    boolean isAutoApprove;

    CatalogActionPaneTab.enabled(!isNewCatalog);
    UploadActionPane.enabled(!isNewCatalog);

    if (CatVendorCatalog)
    {
        isCatalogDeleted = catVendorCatalog.IsDeleted == NoYes::Yes;
        isAutoApprove = catVendorCatalog.IsAutomatedApprovalEnabled == CatVendorCatalogAutomatedApproval::Enabled;

        enableAutomatedApproval.enabled(CatVendorCatalog.canEnableDisableAutoApproval(true));
        disableAutomatedApproval.enabled(CatVendorCatalog.canEnableDisableAutoApproval(false));
        deleteButton.enabled(!isCatalogDeleted);

        catVendorcatalogFileUpload.enabled(!isCatalogDeleted);
        catVendorCatalog_ds.allowEdit(!isCatalogDeleted);
        ReleaseApprovedProducts.enabled(!isCatalogDeleted);
    }
}

public int active()
{
    int ret;
    ret = super();

    if (catVendorCatalog)
    {
        if (!CatVendorCatalog::isVendorExist(catVendorCatalog.RecId) )
        {
            isVendorExist = false;
            //This vendor is no longer active. You cannot modify a catalog unless the vendor is set up in Microsoft Dynamics AX, has a valid status,
            //and has been configured for catalog import.
            warning("@SYS340593");
        }

        vendorName.allowEdit(false);

        // Once the catalog is created, form mode will change from new mode to edit mode. So set the isNewCatalog to false.
        isNewCatalog = false;

        element.setControls();
    }

    return ret;
}

/// <summary>
/// Validates the creation of new catalog from <c>CatVendorCatalogMaintenanceRequest</c> form.
/// </summary>
/// <returns>
/// true if catalog is created, else false.
/// </returns>
/// <exception cref="Exception::Error">
/// Root folder for catalog import processing is not configured.
/// Go to Setup -> Catalog Import -> vendor Catalog import root folder form and configure Root folder for catalog import.
/// </exception>
public boolean validateWrite()
{
    boolean ret;
    if (isNewCatalog)
    {
        if (!str2int64(vendorName.valueStr()))
        {
            //Ensure vendor name is selected.
            warning(strFmt("@SYS304394", "@SYS8079"));
            return false;
        }

        if (catVendorCatalog_Name.valueStr() == strMin())
        {
            //Ensure catalog name is entered.
            warning(strFmt("@SYS304394", "@SYS136511"));
            return false;
        }

        if (CatVendorCatalogMaintenance::isVendorPartyEnabled(catVendorCatalog.VendorParty))
        {
            //Check whether vendor is enabled for catalo import. if yes create the catalog
            ret = super();
        }
        else
        {
            // Take the confirmation from user to enable the vendor for catalog import and create the catalog.
            if (Box::yesNo("@SYS320633", DialogButton::Cancel, "@SYS320634"))
            {
                if (CatVendorChannel::find(catVendorCatalog.VendorParty))
                {
                    CatVendorConfiguration::enableVendorForCatalogImport(catVendorCatalog.VendorParty);
                }
                else
                {
                    CatVendorConfiguration::configureVendorForCatalogImport(catVendorCatalog.VendorParty);
                }
                ret = super();
            }
        }
    }
    else
    {
        ret = super();
    }
    return ret;
}

public void create(boolean _append = false)
{
    super(_append);

    isNewCatalog = true;

    vendorName.allowEdit(true);
    element.setAllControls();
}

public int active()
{
    CatVendorCatalogImportEventLog  catVendorCatalogImportEventLog;
    CatVendorProductCandidate       catVendorProductCandidate;
    int ret;

    ret = super();

    select firstonly RecId from catVendorProductCandidate
        where catVendorProductCandidate.CatalogMaintenanceRequest == catVendorCatalogMaintenanceRequest.RecId;

    select firstonly RecId from catVendorCatalogImportEventLog
        where catVendorCatalogImportEventLog.CatVendorCatalogMaintenanceRequest == catVendorCatalogMaintenanceRequest.RecId;

    catalogReviewTool.enabled(catVendorProductCandidate.RecId);
    catVendorMaintenanceEventLog.enabled(catVendorCatalogImportEventLog.RecId);

    return ret;
}

public void init()
{
    super();
    this.query().dataSourceTable(tableNum(CatVendorCatalogMaintenanceRequest)).addSortField(fieldNum(CatVendorCatalogMaintenanceRequest, CreatedDateTime), SortOrder::Descending);
}

public void executeQuery()
{
    QueryBuildDataSource    qbds;
    QueryBuildRange         qbr;
    qbds = this.queryBuildDataSource();
    qbr = SysQuery::findOrCreateRange(qbds,fieldNum(CatVendCatalogFileStatusInLegalEntity,CmrID));
    qbr.status(RangeStatus::Hidden);
    qbr.value(queryValue(CatVendorCatalogMaintenanceRequest.RecId));
    super();
}

public Common lookupReference()
{
    Query                   query = new Query();
    QueryBuildDataSource    qbdsDirParty, qbdsVendTable;
    SysReferenceTableLookup sysTableLookup;

    query.allowCrossCompany(true);

    qbdsDirParty    = query.addDataSource(tablenum(DirPartyTable));
    qbdsVendTable   = qbdsDirParty.addDataSource(tablenum(VendTable));

    qbdsVendTable.relations(true);
    qbdsVendTable.joinMode(JoinMode::ExistsJoin);

    sysTableLookup  = SysReferenceTableLookup::newParameters(tablenum(DirPartyTable), this);
    sysTableLookup.addLookupfield(fieldnum(DirPartyTable, Name));
    sysTableLookup.addLookupfield(fieldnum(DirPartyTable, PartyNumber));

    sysTableLookup.parmQuery(query);

    return sysTableLookup.performFormLookup();
}

public Common resolveReference()
{
    Common          ret;
    DirPartyTable   partyTable;
    VendTable       vendTable;
    DirPartyName    partyName;

    partyName = this.filterValue(
                    AbsoluteFieldBinding::construct(fieldstr(DirPartyTable, Name),
                    tablestr(DirPartyTable))
                    ).value();

    select crossCompany Name,PartyNumber from partyTable
            where partyTable.Name == partyName
        exists join party from vendTable
            where vendTable.Party == partyTable.RecId;

    ret = super();
    return partyTable;
}

void clicked()
{
    CatVendorCatalog        catVendorCatalogNew;

    // After opening this form, without closing it, assume user navigates to catalog list page and deletes the catalog.
    // Now, when user comes to this form again(assume user not pressed F5 either), the CatVendorCatalog table context is still old.
    // In this case need to get the right context of the Catvendorcatalog table and stop the user from uploading the catalog file.
    catVendorCatalogNew     = CatVendorCatalog::findRecId(catVendorCatalog.RecId);
    if (catVendorCatalogNew.IsDeleted == NoYes::Yes)
    {
        this.enabled(false);
        throw error(strFmt("@SYS339254",catVendorCatalogNew.Name));
    }

    if (!isVendorExist )
    {
        //This vendor is no longer active. You cannot modify a catalog unless the vendor is set up in Microsoft Dynamics AX, has a valid status,
        //and has been configured for catalog import.
        throw error("@SYS340593");
    }

    // Denial of service (DoS) if number of in process files exceeds the system specified limit.
    // Here in process means, files which are uploaded to pickup folder but not processed by AIF service.
    CatCatalogImportFile::ensureFileUploadable();
    super();

    catVendorCatalogMaintenanceRequest_DS.research();
}
